INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (1, 1, 'Aliquid quasi amet enim quam.', 'Aut in dolor aspernatur soluta eaque. Ab dolorem porro libero nihil in nemo qui. Quisquam beatae quo sint quam quia voluptas.', 'Dicta cupiditate voluptates quo labore id occaecati. Nostrum dolor qui voluptatem eos consequatur molestiae. Et suscipit quia omnis nam est. Nulla soluta eaque ea sequi eius natus.', '1986-05-04');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (2, 2, 'Vel culpa id deleniti aut eligendi sunt veritatis.', 'Dignissimos ratione voluptatem est facere quia. Quis atque ipsam eos. Saepe neque consequatur porro iure ullam porro.', 'Et sunt molestiae quis assumenda alias. Eaque odio possimus doloribus facere vel harum. Accusamus animi asperiores dolore alias architecto.', '1989-02-09');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (3, 3, 'Laborum suscipit velit corporis rem nulla.', 'Voluptatem ipsa magnam molestiae est. Sed fugit vel voluptas ab nam vel. Nemo tempore perferendis repellat mollitia.', 'Sunt velit quis asperiores earum similique repellat. Cum ut doloremque ea. Nulla optio et ea exercitationem quam. Voluptatem sit similique repudiandae aut quis.', '1997-01-28');
